import axios from "axios"
import ApiURL from "../../global/ApiURL"

export default async function RegisterUser (user: string, email: string, cpf: string, password: string) {
//   console.log(`
//     user: ${user}
//     email: ${email}
//     cpf: ${cpf}
//     password: ${password}
//   `)

  const data = {
      user: user,
      email: email,
      cpf: cpf,
      password: password
  }

  const send = await axios(`${ApiURL}`, data)
}
